    <div id=""pagepiling"">

        <div class=""section"" id=""start"">
            <h1 style=""background:rgba(0,0,0,.4);padding:40px!important;"">Victoria Falls To Victoria Falls</h1>
            <p style=""background:rgba(0,0,0,.4);padding:10px!important;"">Scroll To Begin Tour</p>
        </div>


        <div class=""section"" id=""day1"">


            <div class=""bgdark"">
                <h1>Victoria Falls</h1>
                In the town of Victoria Falls you will get to experience the sight and sound of the mighty falls.
                This thundering curtain of water is about a mile wide,
                falling 108 metres down into a narrow gorge below.
                In the wet season, the spray created can rise up an incredible 400 metres and the falls become
                an imp");
                WriteLiteral(@"ressive raging torrent. In the dry season the view of the falls is unobstructed.
                Your Campsite tonight has Wi-Fi, an ATM and optional upgrades.
                Your tour leader will take you to a local activity centre where a range of activities will be on offer.

                <br />
                <br />
                <ul>
                    <li>
                        Accomodation: Accomodation ( with shared facilities) (1 night)
                    </li>
                    <li>
                        Included activities:
                        Victoria Falls – Victoria Falls entrance fee
                    </li>
                    <li>
                        Optional Activities:
                        Victoria Falls sunset cruise
                    </li>
                    <li>
                        Meals included:
                        Breakfast,
                        Lunch
                    </li>
                </ul>
            </div>

");
                WriteLiteral(@"        </div>

        <div class=""section"" id=""day2"">
            <div class=""bgdark"">
                <h1>
                    Hwange National Park
                </h1>
                Leave Victoria Falls behind and head to Hwange National Park (approximately 6 hours depending on traffic).
                You will explore this stunning wildlife Arena in an open 4 X 4 vehicle.
                Hwange National Park became the royal hunting grounds of the Ndebele
                warrior king Mzilikazi in the early 19th century.
                And was set aside as a national park in 1929. Today Hwange boasts of a
                tremendous selection of wildlife with over 100 species of mammals and nearly 400 bird species.
                The elephants of  Hwange are world famous; here you will find one of the largest populations in Africa. At tonight’s camp there will is Wi-Fi as well as optional accommodation upgrades (subject to availability).


                <br />
                <br /");
                WriteLiteral(@">
                <ul>
                    <li>
                        Accommodation:
                        Accommodated (with facilities) (2 nights)
                    </li>
                    <li>
                        Included activities:
                        Hwange National Park game drives

                    </li>
                    <li>
                        Optional Activities:
                        Victoria Falls sunset cruise
                    </li>
                    <li>
                        Meals included:
                        Breakfast,
                        Lunch,
                        Dinner
                    </li>
                </ul>

            </div>
        </div>

        <div class=""section"" id=""day4"">

            <div class=""bgdark"">
                <h1>Victoria Falls Flight</h1>

                After breakfast we make a departure back to Victoria Falls to catch a flight to Bulawayo.

            </div>

        </di");
                WriteLiteral(@"v>

        <div class=""section"" id=""day5"">

            <div class=""bgdark"">
                <h1>Matopos National Park</h1>

                Depart Bulawayo for Matobo Hills. This morning have a unique experience tracking rhinos on foot with the help of your guides. Here there will be the chance to spot other game (the park is home to klipspringers, leopards, warthogs and springhares among many others.

                You can also learn about the various local plant and tress, wild pear and paperback among them, while discovering bushman paintings and intriguingly rock formations. After a cold lunch venture to nearby African villages and meet some of the local community.

                <br />
                <br />
                <br />
                <ul>
                    <li>
                        Accommodation:
                        Accommodated (with facilities) (2 nights)
                    </li>
                    <li>
                        Included activities:
    ");
                WriteLiteral(@"                    Matopos National Park – Guided walking safari( Rhino tracking )

                    </li>
                    <li>
                        Meals included:
                        Breakfast,
                        Lunch,
                        Dinner
                    </li>
                </ul>


            </div>

        </div>

        <div class=""section"" id=""day6"">

            <div class=""bgdark"">
                <br />
                <h1>Gweru Antelope Park</h1>

                <br />
                <ul>
                    <li>
                        Accommodation:
                        Accommodated (with facilities) (2 nights)
                    </li>
                    <li>
                        Included activities:
                        Lion Walks,
                        Lion Cub Viewing,
                        Lion Feeding,
                        Elephant Rides and Training,
                        Night Encounter,
       ");
                WriteLiteral(@"                 Explore the Bush,
                        Fishing,
                        Canoeing, Boating and Sundowner Cruises,
                        Horse Rides and Lessons

                    </li>
                    <li>
                        Meals included:
                        Breakfast,
                        Lunch,
                        Dinner
                    </li>
                </ul>


            </div>

        </div>

        <div class=""section"" id=""day8"">


            <div class=""bgdark"">
                <h1>
                    Great Zimbabwe Ruins
                </h1>
                Morning drive to Masvingo to World Heritage listed Great Zimbabwe Ruin & wander through the ruins of this extraordinary architectural site of Africa. The ruined city, now a UNESCO World Heritage site, was first constructed in the 11th century. It's thought to be the former royal palace of the Zimbabwean monarch. Spend a few hours exploring this intriguing site befo");
                WriteLiteral(@"re heading off to camp. Your campground in Masvingo has shared facilities, with upgrades and WiFi available.
                <br />
                <br />
                <ul>
                    <li>
                        Accommodation:
                        Accommodated (with facilities) (1 nights)
                    </li>
                    <li>
                        Included activities:
                        Masvingo - Great Zimbabwe Ruins guided visit<br />
                    </li>
                    <li>
                        Meals included:
                        Breakfast,
                        Lunch,
                        Dinner
                    </li>
                </ul>


            </div>
        </div>

        <div class=""section"" id=""day9"">

            <div class=""bgdark"">

                <h1>Capital of Zimbabwe (Harare)</h1>
                Travel to Harare today (approximately 8–9 hours). The first part of your journey takes you to the bo");
                WriteLiteral(@"rder with Zimbabwe. After formalities, enjoy a nice scenic drive of 60 kilometres or so, then continue to Harare. There will be a chance to stock up on whatever you need at a market or shop and visit an ATM. On arrival in Zimbabwe's capital you will have the afternoon to explore the town as you please. Perhaps head to the botanical gardens or local Sunday markets. Upgrades are available at camp; there is no WiFi, however.
                <br />
                <br />
                <ul>
                    <li>
                        Accommodation:
