                    </li>");
                WriteLiteral(@"
                </ul>


            </div>

        </div>

        <div class=""section"" id=""day10"">

            <div class=""bgdark"">

                <h1>Chinhoyi Caves</h1>
                Depart for Chinhoyi caves in another city in Zimbabwe ,Chinhoyi. With an activity like scuba diving, Chinhoyi Caves is regarded to be on a par with some of the best dive sites in the worldand has fantastic visibility. There are tunnels leading off sleeping pool and dark cave.Divers of all qualifications have something to enjoy though bouyance control is a must. You will need to dive with a registered dive club
                <br />
                <br />
                <ul>
                    <li>
                        Accommodation:
